window.bookSummaryJSON = "<p>She thought Cupid’s arrow would never find her. Love sent a missile instead.</p> <p>Being the onboard matchmaker for an interstellar dating cruise isn’t the most exciting job in the world, but that’s fine. Joy likes things to be calm and orderly. But then the ship gets attacked, and her captain orders her into an escape pod with two VIPs and instructions to keep everyone alive.</p> <p>Crashing on an unknown planet is one excursion she never planned for. The wildlife is dangerous, the terrain is treacherous, and the only help available comes in the form of a tall, horned alien with the sex appeal of a rock star and a stubborn streak wider than the Milky Way.</p> <p>He’s certain she belongs to him. She’s convinced he’s crazy. She’s got a long list of reasons why it could never work, but the big, sexy alien has his charms, and he’s willing to use them all to get what he wants. Her.</p> <p>After years of helping others look for love, this might be Joy’s chance to find it for herself—but only if she’s willing to take the risk.</p> <p>Buckle up. This sci-fi romance contains an alien with fur, fangs, horns, and a very possessive attitude when it comes to the woman he’s claimed for his own<i>.</i></p>"; 
